import Nav from "../Nav/Nav";
import Banner from "../Banner/Banner";
import Card from "../Card/Card";
import axios from "axios";

const api_key = "51560beb187e60946bf18e17a32f687c";
const url = "https://api.themoviedb.org/3";
const imgURL =
  "https://image.tmdb.org/t/p/original";

const Homescreen = () => {
  useEffect(() => {
    const fetchData = async () => {
      const { data } = await axios.get(
        "https://api.themoviedb.org/3/movie/popular?api_key=51560beb187e60946bf18e17a32f687c&language=en-US&page=1"
      );
      console.log(data.get.results.backdrop_path);
    };
    fetchData();
  }, []);

  return (
    <div>
      <Nav />
      <Banner />

      <Card img="https://th.bing.com/th/id/OIP.bLAA5hV_t4A2Vnc4CDbe4gHaEK?pid=ImgDet&rs=1" />
    </div>
  );
};

export default Homescreen;
